import React from "react";
import "./About.css";

import avatarMaker from "./AvatarMaker.png";

export default function About() {
  return (
    <section className="about-container">
      <div className="about-holder">
        <div className="about-top">


          <p className="about-me">
            Hi
          </p>
        </div>

      </div>
    </section>
  );
}

<section class="aboutme">
<h2 class="sectiontitle" id="aboutme">About Me</h2>
<div class="profilepic" title="profilepic">
  <img
    className="profile-picture"
    src={avatarMaker}
    alt="George Melies moon rocket"
  ></img>
</div>
<p class="aboutmecontent">My name is Louis Yoon. I have no prior developing experience and
    learning from scratch. I am enjoying coding and would love the opportunity to switch careers into this field.</p>
</section>
